import * as style from "../../css/light/focusedList"
import FocusedUserItem from "./focusedUserItem"

export default function FocusedUserList(props) {
  const renderFocusedUserItem = (list) => {
    if (list) {
      return list.map((item, i) => (
        <div key={`user${i}`}>{item}</div>
      ))  
    }
    else return (<div></div>)
  }

  console.log(props)
  return props.profile['users'].map((item, i) => (
    <div style={style.focusContentContainer}>
      <div>{item}</div>
      <div style={{display: "flex"}}>
        <div style={{width: "14.55vw"}}>Lines
          <div style={{...style.divider, margin: "3px 0px 2px 30px", width: "11.5vw"}}></div>
          <FocusedUserItem list={props.profile['lines'][i]}/>
        </div>
        <div style={{width: "14.2vw"}}>BLF
          <div style={{...style.divider, margin: "3px 0px 2px 26px", width: "11.5vw"}}></div>
           {renderFocusedUserItem(props.profile['blfs'][i])}
        </div>
      </div>
    </div>
  ))
}
